import { Layout, Page, EmptyState } from '@shopify/polaris';

const Index = () => (
  <Page>
		<Layout>
			<TextStyle variation="positive">
				<h1>Sample app using React and Next.js</h1>
			</TextStyle>
		</Layout>
  </Page>
);

export default Index;
